import MotionHoc from "./MotionHoc";
import styled from "styled-components";

const Section = styled.div`
    width: 100%;
    padding: 20%;
    text-align: center;
    color: white;
`;

const TeamComponent = () => {
  return  <Section>
            <h1>Team</h1>
            <h3>Session Drummer & Studio Owner</h3>
            <h4>Lucas Mckinnon: Silversidesound.com</h4>
          </Section>;
};

const Team = MotionHoc(TeamComponent);

export default Team;
